import React, { Component } from 'react'
import axios from 'axios'
import ReactTable from "react-table"; 
// import 'react-table/react-table.css'

export default class App extends Component {
  constructor(props){
    super(props)
    this.state = {
     admins: [],
      loading:true
    }
  }
  async getUsersData(){
    const res = await axios.get('http://localhost:3000/admin/alladmin')
    console.log(res.data)
    this.setState({loading:false, admins: res.data})
  }
  componentDidMount(){
    this.getAdminsData()
  }
  render() {
    const columns = [{  
      Header: 'Full name',  
      accessor: 'full_name',
     }
     ,{  
      Header: 'Phone',  
      accessor: 'phone' ,
      }
     
     ,{  
     Header: 'Password',  
     accessor: 'password' ,
     }
      
    
  ]
    return (
      <ReactTable  
      data={this.state.admins}  
      columns={columns}  
   />
    )
  }
}
